The CAT protocol extends on the existing mempool implementations by introducing two new protobuf messages: message SeenTx { bytes tx_key = 1; optional string from = 2;
} message WantTx { bytes tx_key = 1;
} Both SeenTx and WantTx contain the sha256 hash of the raw transaction bytes. SeenTx also contains an optional p2p.ID that corresponds to the peer that the node received the tx from. The only validation for both is that the byte slice of the tx_key MUST have a length of 32. Both messages are sent across a new channel with the ID: byte(0x31). This enables cross compatibility as discussed in greater detail below. Note: The term SeenTx is used over the more common HasTx because the transaction pool contains sophisticated eviction logic. TTLs, higher priority transactions and reCheckTx may mean that a transaction pool had a transaction but does not have it any more. Semantically it's more appropriate to use SeenTx to imply not the presence of a transaction but that the node has seen it and dealt with it accordingly.
